import { Link } from 'react-router-dom';

const NotFound = () => {
  return (
    <div className='container not-found'>
      <h2>
        Sorry! The movie that you're looking for is unavailable in the data
        base.
      </h2>
      <Link to='/about'>Back to Search</Link>
    </div>
  );
};

export default NotFound;
